const App = () => {
    const plotData = [[0, 1], [1, 2], [2, 4], [3, 2], [4, 7]]
    return (
        <>
            <h1>Room Solver</h1>
            <Grid container spacing={3} justify="center">
                <Grid item xs={10}>
                    <RoomInputGrid />
                </Grid>
            </Grid>
        </>
    );
};


export default App;
